import React from "react";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import PersonIcon from "@mui/icons-material/Person";

export default function Spese() {
  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "rgb(20, 42, 58)",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        style={{
          height: "90%",
          width: "80%",
          //backgroundColor: "rgb(203, 231, 253)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "10%",
            width: "100%",
            //backgroundColor: "rgb(94, 175, 70)",
          }}
        >
          <Typography
            variant="h4"
            style={{ color: "#fcfcfc" }}
            sx={{ fontWeight: "bold" }}
          >
            Spese page
          </Typography>
        </Grid>
        <Grid
          container
          direction="column"
          style={{
            borderRadius: "5%",
            height: "90%",
            width: "100%",
            backgroundColor: "rgb(203, 231, 253)",
          }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            style={{
              height: "75%",
              width: "100%",
              backgroundColor: "rgb(93, 131, 53)",
            }}
          ></Grid>
          <Grid
            container
            direction="column"
            justifyContent="flex-start"
            alignItems="flex-start"
            style={{
              height: "25%",
              width: "100%",
              //backgroundColor: "rgb(193, 31, 153)",
              overflow: "auto",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="flex-start"
              alignItems="center"
              style={{
                marginTop: "1%",
                height: "70%",
                width: "25%",
                marginLeft: "2%",
                backgroundColor: "rgb(43, 111, 113)",
              }}
            >
              <Grid
                container
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "100%",
                  width: "50%",
                  backgroundColor: "rgb(143, 211, 63)",
                }}
              >
                <PersonIcon
                  sx={{
                    height: "70%",
                    width: "100%",
                    //backgroundColor: "rgb(143, 11, 113)",
                  }}
                />
              </Grid>
              <Grid
                container
                direction="column"
                justifyContent="center"
                alignItems="center"
                style={{
                  height: "100%",
                  width: "50%",
                  backgroundColor: "rgb(143, 211, 113)",
                }}
              >
                <Typography>nome</Typography>
                <Typography>-100</Typography>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}
